export default function StartPomodoro({ setstarted }) {

    const handleClick = () => {
        setstarted()
    }

    return (
        <div>
            <h2>Start Pomodoro</h2>
            <button onClick={handleClick}>Start Pomodoro</button>
        </div>
    )
}
